· Complete gym set includes ankle straps, weight lifting straps, barbell pad, exercise band, microfiber towel and bag 
· Made with durable, resilient materials and designs; 
· Nice gift choice for gym lovers; 
· Modern and cool black/pink color combination; 
· High density EVA foam for superior grip and hold; 
· Improves technique and performance. 
This barbell pad can be employed for a wide range of exercises that target different muscle groups. An excellent idea for Barbell Squat, Hip Thrust, Lunge, Hip Abduction and Adduction, Hip Rebound, Leg Extension, Leg Curl, Weight Training and more!

